import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Undo2, Redo2, Trash2 } from 'lucide-react';
import { useMoodboard } from '../context/MoodboardContext';
import { stickers, categories } from '../utils/stickersData';

const SidebarContainer = styled.div`
  display: flex;
  flex-direction: column;
  height: 100%;
  overflow: hidden;
  background-color: var(--bg-primary);
  border-right: 1px solid var(--border-color);
`;

const CategorySection = styled.div`
  margin-bottom: 16px;
`;

const CategoryTitle = styled.h3`
  font-size: 0.95rem;
  color: var(--text-secondary);
  margin: 0 0 10px 0;
  padding: 0 12px;
  display: flex;
  align-items: center;
  gap: 8px;
`;

const StickersGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 10px;
  padding: 0 12px;
`;

const StickerItem = styled(motion.div)`
  aspect-ratio: 1;
  background: var(--sticker-bg);
  border-radius: 10px;
  padding: 8px;
  cursor: grab;
  box-shadow: 0 4px 6px rgba(0,0,0,0.1);
  display: flex;
  align-items: center;
  justify-content: center;
  transition: transform 0.2s ease, box-shadow 0.2s ease;
  will-change: transform;
  transform-style: preserve-3d;
  perspective: 800px;

  &:hover {
    transform: translateY(-4px) rotateX(5deg) rotateY(5deg);
    box-shadow: 0 8px 12px rgba(0,0,0,0.2);
  }

  img {
    width: 100%;
    height: 100%;
    object-fit: contain;
    pointer-events: none;
  }
`;

const ActionsContainer = styled.div`
  padding: 16px 12px;
  border-top: 1px solid var(--border-color);
  background-color: var(--bg-primary);
`;

const IconButton = styled.button`
  display: flex;
  align-items: center;
  gap: 6px;
  padding: 8px 12px;
  margin: 6px 0;
  border: none;
  border-radius: 6px;
  background-color: var(--bg-secondary);
  color: var(--text-primary);
  cursor: pointer;
  transition: background 0.2s ease;

  &:hover {
    background-color: var(--bg-tertiary);
  }

  &:disabled {
    opacity: 0.5;
    cursor: not-allowed;
  }

  svg {
    width: 16px;
    height: 16px;
  }
`;

const Sidebar: React.FC = () => {
  const { state, dispatch } = useMoodboard();

  const handleDragStart = (e: React.DragEvent, sticker: any) => {
    e.dataTransfer.setData('application/json', JSON.stringify(sticker));
  };

  const handleDeleteSelected = () => {
    if (state.selectedSticker) {
      dispatch({ type: 'DELETE_STICKER', payload: state.selectedSticker });
    }
  };

  const handleUndo = () => {
    dispatch({ type: 'UNDO' });
  };

  const handleRedo = () => {
    dispatch({ type: 'REDO' });
  };

  return (
    <SidebarContainer>
      {categories.map(category => (
        <CategorySection key={category.id}>
          <CategoryTitle>
            <span>{category.icon}</span>
            {category.name}
          </CategoryTitle>
          <StickersGrid>
            {stickers
              .filter(sticker => sticker.category === category.id)
              .map(sticker => (
                <StickerItem
                  key={sticker.id}
                  draggable
                  whileTap={{ scale: 0.95 }}
                  whileHover={{ rotateX: 5, rotateY: 5 }}
                  onDragStart={(e) => handleDragStart(e, sticker)}
                >
                  <img src={sticker.image} alt={sticker.name} loading="lazy" />
                </StickerItem>
              ))}
          </StickersGrid>
        </CategorySection>
      ))}

      <ActionsContainer>
        <h3 style={{ marginBottom: '8px' }}>Actions</h3>
        <IconButton onClick={handleUndo} disabled={state.historyIndex === 0}>
          <Undo2 /> Undo
        </IconButton>
        <IconButton
          onClick={handleRedo}
          disabled={state.historyIndex === state.history.length - 1}
        >
          <Redo2 /> Redo
        </IconButton>
        <IconButton onClick={handleDeleteSelected} disabled={!state.selectedSticker}>
          <Trash2 /> Delete Selected
        </IconButton>
      </ActionsContainer>
    </SidebarContainer>
  );
};

export default Sidebar;
